import React from "react";

function TaskList(selectCategory, category) {
  return (
    <div>
      {category === "All"
        ? selectCategory.map((eachCat) => {
            return eachCat.map((task) => {
              return <p>{task}</p>;
            });
          })
        : selectCategory.map((task) => <p> {task}</p>)}
    </div>
  );
}

export default TaskList;
